export default function NextButton({ dispatch, activeQuestion, numQuestions }) {
  if (activeQuestion < numQuestions - 1) {
    return (
      <button
        className="btn btn-ui"
        onClick={() => dispatch({ type: "nextQuestion" })}
      >
        Next
      </button>
    );
  } else {
    return (
      <>
        {true && (
          <button
            className="btn btn-ui"
            onClick={() => dispatch({ type: "goToFinishScreen" })}
          >
            Finish
          </button>
        )}
      </>
    );
  }
}
